chatter[9167][2] = "People infected with HIV (the virus that causes AIDS), Hepatitis C, and other diseases when they share needles. Both HIV and Hepatitis C can be fatal. Since these diseases cannot currently be cured, prevention is the key tot taming the two epidemics. Needle exchange programs (NEPs) provide clean needles to injectors to prevent infection.";
